PowerLine Lightning
The fast and durable Lightning cable.

Heavy Duty for Heavy Use
We've reinforced PowerLine with bulletproof aramid fiber-a first for a USB charging cable. We've bent this cable over 5000 times and observed no damage or change in performance.

Flexibility
With the 6-foot PowerLine Lightning, you don't have to sit near a power outlet as you charge your device. Instead, you have the flexibility to set up your work environment as you prefer.

Apple MFi Certified
Each PowerLine cable contains a unique authorization chip of the latest kind issued by Apple to ensure 100% sync and charge compatibility with any Lightning device.

Works With:
• iPhone 7/ 6s / 6s Plus / 6 / 6 Plus / 5s / 5c / 5
• iPad Air / Air 2 / Pro, iPad mini / mini 2 / mini 3 / mini 4, iPad (4th generation)
• iPod nano (7th generation) and iPod touch (5th / 6th generation)

Please Note:
This cable is not compatible with Lifeproof iPhone 6 / 6 Plus cases. It will fit Lifeproof cases for other Apple devices as well as the vast majority of cases from other manufacturers.

